import React, { useState } from "react";
import { Suspense, lazy } from "react";
import { Navigate, Route, Routes } from "react-router-dom";
import { ApplicationProvider } from "./ThemeContext";
import "./App.css";
import Loader from "./Components/Loader";
const LazyLogInPage = lazy(() => import("./Pages/LogInPage"));
const LazyHomePage = lazy(() => import("./Pages/HomePage"));
const LazyFavoritesPage = lazy(() => import("./Pages/FavoritesPage"));

function App() {
  const [user, setUser] = useState("");
  const [password, setPassword] = useState("");
  const getUser = localStorage.getItem("username");
  const getPassword = localStorage.getItem("password");

  console.log(getUser);
  console.log(getPassword);
  return (
    <div className="div-app">
      <ApplicationProvider value={user}>
        <Suspense fallback={<Loader />}>
          <Routes>
            {getUser && getPassword ? (
              <>
                <Route path="/home" element={<LazyHomePage />} />
                <Route path="/favorites" element={<LazyFavoritesPage />} />
                <Route path="*" element={<Navigate to="/home" replace />} />
              </>
            ) : (
              <>
                <Route path="/" element={<LazyLogInPage />} />
                <Route path="*" element={<Navigate to="/" replace />} />
              </>
            )}
          </Routes>
        </Suspense>
      </ApplicationProvider>
    </div>
  );
}

export default App;
